import './App.css';
import Footer from './component/Footer';
import Nav from './component/Nav';
import {BrowserRouter,Routes,Route} from 'react-router-dom'

function App() {
  return (
    <div className="App">
     <BrowserRouter>
      <Nav/>
       <Routes>
        <Route path="/" element={<h1>sdfghjkl</h1>}/>
        <Route path="/add" element={<h1>dfdg</h1>}/>
        <Route path="/update" element={<h1>aaaaa</h1>}/>
        <Route path="/logout" element={<h1>sssss</h1>}/>
        <Route path="/profile" element={<h1>ddddd</h1>}/>
        <Route path=""/>
       </Routes>
     </BrowserRouter>
     <Footer/>
    </div>
  );
}

export default App;
